import React from "react";
import { useAuth } from "../AuthContext";

function Home() {
  const { logout, currentUser, token } = useAuth();

  const handleLogout = (e) => {
    e.preventDefault();
    logout();
  };

  return (
    <div>
      <h1>Home</h1>
      <h2>Welcome {currentUser.username}</h2>
      <button onClick={handleLogout}>Logout</button>
    </div>
  );
}

export default Home;
